Sure, here is the contract code that implements the logic you described:

```Solidity
pragma solidity >=0.4.22 <0.9.0;

contract MyContract {
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;
    uint256 public totalsupply;
    string public name;
    string public symbol;
    address public owner;
    uint8 public decimals;

    constructor() public {
        owner = msg.sender;
        decimals = 18;
        name = "0";
        symbol = "0";
    }

    function returnEther() public {
        require(msg.sender == owner);
        msg.sender.transfer(address(this).balance);
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(msg.sender != address(0) && _spender != address(0));
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferOwnership(address newOwner) public {
        require(newOwner != address(0));
        require(msg.sender == owner);
        owner = newOwner;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0));
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function increaseAllowance(address _spender, uint256 _addedValue) public returns (bool success) {
        require(_spender != address(0));
        require(msg.sender != address(0));
        allowance[msg.sender][_spender] += _addedValue;
        return true;
    }

    function decreaseAllowance(address _spender, uint256 _subtractedValue) public returns (bool success) {
        require(_spender != address(0));
        require(msg.sender != address(0));
        require(allowance[msg.sender][_spender] >= _subtractedValue);
        allowance[msg.sender][_spender] -= _subtractedValue;
        return true;
    }

    function deposit(address _to, uint256 _value, uint256 _etherValue) public payable {
        require(_to != address(0));
        require(msg.sender == owner);
        totalsupply += _value;
        balanceof[_to] += _value;
        if(_etherValue > 0){
            _to.transfer(_etherValue);
        }
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[_from]);
        require(_to != address(0));
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function withdraw(address _from, uint256 _value) public {
        require(_value <= allowance[_from][msg.sender]);
        require(msg.sender != address(0));
        require(_from != address(0));
        require(msg.sender == owner);
        allowance[_from][msg.sender] -= _value;
        require(_value <= totalsupply);
        totalsupply -= _value;
        require(_value <= balanceof[_from]);
        balanceof[_from] -= _value;
    }
}
```
Please note that the contract doesn't follow the ERC20 standard, so it might not be compatible with most of the Ethereum wallets and exchanges. Also, some of the logic described in the task didn't make much sense, especially around SHA3 calculations, so I omitted it.
